window.bookSummaryJSON = "<p>Ryker</p> <p>After learning about the web of secrets between my father and Leo, I'm more determined than ever to save Tempest from the monsters ruling it. I’ll do whatever it takes to destroy them… even if it means stealing from the earl at his ball.</p> <p>Ellery</p> <p>I never could’ve imagined the horrors that would unravel at the earl’s ball or that one night would change our lives forever.</p> <p>Return to the Shadow Realms. A world where immortals unleash lightning, dark fae seduce, witches cast their spells, dragons rule the skies… and the legend of Robin Hood comes alive in a new way.</p> <p>***The Tempest Series is a spinoff of the Shadow Realms series. You do not have to read the Shadow Realms series to follow this one.</p> <p>Due to sexual content, violence, and language, this book is recommended for listeners 18+ years of age.***</p>"; 
